import React from 'react';

export default function Nav() { return (
<nav>
  <a href="/">Howard Automotive</a> | 
  <a href="/cars">Our Cars</a> | 
  <a href="/events">Events</a> | 
  <a href="/sponsors">Sponsors</a> | 
  <a href="/services">Services</a>
</nav>
); }
